C# has a built-in string interpolation feature that allows you to embed expressions inside a string literal. The following example shows how to use string interpolation in C#: string name = "John";
int age = 42;
string str = $"Person {{ Name: {name}, Age: {age} }}"; Rust does not have a built-in string interpolation feature. Instead, the format! macro is used to format a string. The following example shows how to use string interpolation in Rust: let name = "John";
let age = 42;
let str = format!("Person {{ name: {}, age: {} }}", name, age); Custom classes and structs can also be interpolated in C# due to the fact that the ToString() method is available for each type as it inherits from object. class Person
{ public string Name { get; set; } public int Age { get; set; } public override string ToString() => $"Person {{ Name: {Name}, Age: {Age} }}";
} var person = new Person { Name = "John", Age = 42 };
Console.Writeline(person); In Rust, there is no default formatting implemented/inherited for each type. Instead, the std::fmt::Display trait must be implemented for each type that needs to be converted to a string. use std::fmt::*; struct Person { name: String, age: i32,
} impl Display for Person { fn fmt(&self, f: &mut Formatter<'_>) -> Result { write!(f, "Person {{ name: {}, age: {} }}", self.name, self.age) }
} let person = Person { name: "John".to_owned(), age: 42,
}; println!("{person}"); Another option is to use the std::fmt::Debug trait. The Debug trait is implemented for all standard types and can be used to print the internal representation of a type. The following example shows how to use the derive attribute to print the internal representation of a custom struct using the Debug macro. This declaration is used to automatically implement the Debug trait for the Person struct: #[derive(Debug)]
struct Person { name: String, age: i32,
} let person = Person { name: "John".to_owned(), age: 42,
}; println!("{person:?}"); Note: Using the :? format specifier will use the Debug trait to print the struct, where leaving it out will use the Display trait. See also: Rust by Example - Debug

