Rust does not have any notion of constructors. Instead, you just write factory functions that return an instance of the type. The factory functions can be stand-alone or associated functions of the type. In C# terms, associated functions are like have static methods on a type. Conventionally, if there is just one factory function for a struct, it's named new: struct Rectangle { x1: i32, y1: i32, x2: i32, y2: i32,
} impl Rectangle { pub fn new(x1: i32, y1: i32, x2: i32, y2: i32) -> Self { Self { x1, y1, x2, y2 } }
} Since Rust functions (associated or otherwise) do not support overloading, the factory functions have to be named uniquely. For example, below are some examples of so-called constructors or factory functions available on String: String::new: creates an empty string. String::with_capacity: creates a string with an initial buffer capacity. String::from_utf8: creates a string from bytes of UTF-8 encoded text. String::from_utf16: creates a string from bytes of UTF-16 encoded text. In the case of an enum type in Rust, the variants act as the constructors. See the section on enumeration types for more. See also: Constructors are static, inherent methods (C-CTOR)

