Like C#, Rust types (both enum and struct), can have static and instance-based methods. In Rust-speak, a method is always instance-based and is identified by the fact that its first parameter is named self. The self parameter has no type annotation since it's always the type to which the method belongs. A static method is called an associated function . In the example below, new is an associated function and the rest (length, width and area) are methods of the type: struct Rectangle { x1: i32, y1: i32, x2: i32, y2: i32,
} impl Rectangle { pub fn new(x1: i32, y1: i32, x2: i32, y2: i32) -> Self { Self { x1, y1, x2, y2 } } pub fn length(&self) -> i32 { self.y2 - self.y1 } pub fn width(&self) -> i32 { self.x2 - self.x1 } pub fn area(&self) -> i32 { self.length() * self.width() }
}

