In C#, fields of a type are generally private. They are then protected/encapsulated by property members with accessor methods (get, and set) to read or write to those field. The accessor methods can contain extra logic, for example, to either validate the value when being set or compute a value when being read. Rust only has methods where a getter is named after the field (in Rust method names can share the same identifier as a field) and the setter uses a set_ prefix . Below is an example showing how property-like accessor methods typically look for a type in Rust: struct Rectangle { x1: i32, y1: i32, x2: i32, y2: i32,
} impl Rectangle { pub fn new(x1: i32, y1: i32, x2: i32, y2: i32) -> Self { Self { x1, y1, x2, y2 } } // like property getters (each shares the same name as the field) pub fn x1(&self) -> i32 { self.x1 } pub fn y1(&self) -> i32 { self.y1 } pub fn x2(&self) -> i32 { self.x2 } pub fn y2(&self) -> i32 { self.y2 } // like property setters pub fn set_x1(&mut self, val: i32) { self.x1 = val } pub fn set_y1(&mut self, val: i32) { self.y1 = val } pub fn set_x2(&mut self, val: i32) { self.x2 = val } pub fn set_y2(&mut self, val: i32) { self.y2 = val } // like computed properties pub fn length(&self) -> i32 { self.y2 - self.y1 } pub fn width(&self) -> i32 { self.x2 - self.x1 } pub fn area(&self) -> i32 { self.length() * self.width() }
}

