When designing a type in C#, it is the responsiblity of the developer to decide whether the a type is mutable or immutable; whether it supports destructive or non-destructive mutations. C# does support an immutable design for types with a positional record declaration (record class or readonly record struct). In Rust, mutability is expressed on methods through the type of the self parameter as shown in the example below: struct Point { x: i32, y: i32 } impl Point { pub fn new(x: i32, y: i32) -> Self { Self { x, y } } // self is not mutable pub fn x(&self) -> i32 { self.x } pub fn y(&self) -> i32 { self.y } // self is mutable pub fn set_x(&mut self, val: i32) { self.x = val } pub fn set_y(&mut self, val: i32) { self.y = val }
} In C#, you can do non-destructive mutations using with: var pt = new Point(123, 456);
pt = pt with { X = 789 };
Console.WriteLine(pt.ToString()); // prints: Point { X = 789, Y = 456 } readonly record struct Point(int X, int Y); There is no with in Rust, but to emulate something similar in Rust, it has to be baked into the type's design: struct Point { x: i32, y: i32 } impl Point { pub fn new(x: i32, y: i32) -> Self { Self { x, y } } pub fn x(&self) -> i32 { self.x } pub fn y(&self) -> i32 { self.y } // following methods consume self and return a new instance pub fn set_x(self, val: i32) -> Self { Self::new(val, self.y) } pub fn set_y(self, val: i32) -> Self { Self::new(self.x, val) }
}

