Generics in C# provide a way to create definitions for types and methods that can be parameterized over other types. This improves code reuse, type-safety and performance (e.g. avoid run-time casts). Consider the following example of a generic type that adds a timestamp to any value: using System; sealed record Timestamped<T>(DateTime Timestamp, T Value)
{ public Timestamped(T value) : this(DateTime.UtcNow, value) { }
} Rust also has generics as shown by the equivalent of the above: use std::time::*; struct Timestamped<T> { value: T, timestamp: SystemTime } impl<T> Timestamped<T> { fn new(value: T) -> Self { Self { value, timestamp: SystemTime::now() } }
} See also: Generic data types

