In .NET, exceptions are passed up the stack until they are handled or the program terminates. In Rust, unrecoverable errors behave similarly, but handling them is uncommon. Recoverable errors, however, need to be propagated and handled explicitly. Their presence is always indicated by the Rust function or method signature. Catching an exception allows you to take action based on the presence or absence of an error in C#: void Write()
{ try { File.WriteAllText("file.txt", "content"); } catch (IOException) { Console.WriteLine("Writing to file failed."); }
} In Rust, this is roughly equivalent to: fn write() { match std::fs::File::create("temp.txt") .and_then(|mut file| std::io::Write::write_all(&mut file, b"content")) { Ok(_) => {} Err(_) => println!("Writing to file failed."), };
} Frequently, recoverable errors need only be propagated instead of being handled. For this, the method signature needs to be compatible with the types of the propagated error. The ? operator propagates errors ergonomically: fn write() -> Result<(), std::io::Error> { let mut file = std::fs::File::create("file.txt")?; std::io::Write::write_all(&mut file, b"content")?; Ok(())
} Note : to propagate an error with the question mark operator the error implementations need to be compatible , as described in a shortcut for propagating errors . The most general "compatible" error type is the error trait object Box<dyn Error>.

