The equivalent of IEnumerable<T> in Rust is IntoIterator . Just as an implementation of IEnumerable<T>.GetEnumerator() returns a IEnumerator<T> in .NET, an implementation of IntoIterator::into_iter returns an Iterator . However, when it's time to iterate over the items of a container advertising iteration support through the said types, both languages offer syntactic sugar in the form of looping constructs for iteratables. In C#, there is foreach: using System;
using System.Text; var values = new[] { 1, 2, 3, 4, 5 };
var output = new StringBuilder(); foreach (var value in values)
{ if (output.Length > 0) output.Append(", "); output.Append(value);
} Console.Write(output); // Prints: 1, 2, 3, 4, 5 In Rust, the equivalent is simply for: use std::fmt::Write; fn main() { let values = [1, 2, 3, 4, 5]; let mut output = String::new(); for value in values { if output.len() > 0 { output.push_str(", "); } // ! discard/ignore any write error _ = write!(output, "{value}"); } println!("{output}"); // Prints: 1, 2, 3, 4, 5
} The for loop over an iterable essentially gets desuraged to the following: use std::fmt::Write; fn main() { let values = [1, 2, 3, 4, 5]; let mut output = String::new(); let iter = &mut values.into_iter(); // get iterator loop { // loop indefinitely match iter.next() { // get next item Some(value) => { // when there's an item, do... if output.len() > 0 { output.push_str(", "); } _ = write!(output, "{value}"); }, None => { // when no more items, ... break; // break out of loop } } } println!("{output}");
} Rust's ownership and data race condition rules apply to all instances and data, and iteration is no exception. So while looping over an array might look straightforward and very similar to C#, one has to be mindful about ownership when needing to iterate the same collection/iterable more than once. The following example iteraters the list of integers twice, once to print their sum and another time to determine and print the maximum integer: fn main() { let values = vec![1, 2, 3, 4, 5]; // sum all values let mut sum = 0; for value in values { sum += value; } println!("sum = {sum}"); // determine maximum value let mut max = None; for value in values { if let Some(some_max) = max { // if max is defined if value > some_max { // and value is greater max = Some(value) // then note that new max } } else { // max is undefined when iteration starts max = Some(value) // so set it to the first value } } println!("max = {max:?}");
} However, the code above is rejected by the compiler due to a subtle difference: values has been changed from an array to a Vec<int> , a vector , which is Rust's type for growable arrays (like List<T> in .NET). The first iteration of values ends up consuming each value as the integers are summed up. In other words, the ownership of each item in the vector passes to the iteration variable of the loop: value. Since value goes out of scope at the end of each iteration of the loop, the instance it owns is dropped. Had values been a vector of heap-allocated data, the heap memory backing each item would get freed as the loop moved to the next item. To fix the problem, one has to request iteration over shared references via &values in the for loop. As a result, value ends up being a shared reference to an item as opposed to taking its ownership. Below is the updated version of the previous example that compiles. The fix is to simply replace values with &values in each of the for loops. fn main() { let values = vec![1, 2, 3, 4, 5]; // sum all values let mut sum = 0; for value in &values { sum += value; } println!("sum = {sum}"); // determine maximum value let mut max = None; for value in &values { if let Some(some_max) = max { // if max is defined if value > some_max { // and value is greater max = Some(value) // then note that new max } } else { // max is undefined when iteration starts max = Some(value) // so set it to the first value } } println!("max = {max:?}");
} The ownership and dropping can be seen in action even with values being an array instead of a vector. Consider just the summing loop from the above example over an array of a structure that wraps an integer: struct Int(i32); impl Drop for Int { fn drop(&mut self) { println!("{} dropped", self.0) }
} fn main() { let values = [Int(1), Int(2), Int(3), Int(4), Int(5)]; let mut sum = 0; for value in values { sum += value.0; } println!("sum = {sum}");
} Int implements Drop so that a message is printed when an instance get dropped. Running the above code will print: value = Int(1)
Int(1) dropped
value = Int(2)
Int(2) dropped
value = Int(3)
Int(3) dropped
value = Int(4)
Int(4) dropped
value = Int(5)
Int(5) dropped
sum = 15 It's clear that each value is acquired and dropped while the loop is running. Once the loop is complete, the sum is printed. If values in the for loop is changed to &values instead, like this: for value in &values { // ...
} then the output of the program will change radically: value = Int(1)
value = Int(2)
value = Int(3)
value = Int(4)
value = Int(5)
sum = 15
Int(1) dropped
Int(2) dropped
Int(3) dropped
Int(4) dropped
Int(5) dropped This time, values are acquired but not dropped while looping because each item doesn't get owned by the interation loop's variable. The sum is printed ocne the loop is done. Finally, when the values array that still owns all the the Int instances goes out of scope at the end of main, its dropping in turn drops all the Int instances. These examples demonstrate that while iterating collection types may seem to have a lot of parallels between Rust and C#, from the looping constructs to the iteration abstractions, there are still subtle differences with respect to ownership that not kept in mind at all times otherwise the compiler will end up rejecting the code. See also: Iterator Iterating by reference

