Many operators in LINQ are designed to be lazy such that they only do work when absolutely required. This enables composition or chaining of several operations/methods without causing any side-effects. For example, a LINQ operator can return an IEnumerable<T> that is initialized, but does not produce, compute or materialize any items of T until iterated. The operator is said to have deferred execution semantics. If each T is computed as iteration reaches it (as opposed to when iteration begins) then the operator is said to stream the results. Rust iterators have the same concept of laziness and streaming. In both cases, this allows infinite sequences to be represented, where the underlying sequence is infinite, but the developer decides how the sequence should be terminated . The following example shows this in C#: foreach (var x in InfiniteRange().Take(5)) Console.Write($"{x} "); // Prints "0 1 2 3 4" IEnumerable<int> InfiniteRange()
{ for (var i = 0; ; ++i) yield return i;
} Rust supports the same concept through infinite ranges: // Generators and yield in Rust are unstable at the moment, so
// instead, this sample uses Range:
// https://doc.rust-lang.org/std/ops/struct.Range.html for value in (0..).take(5) { print!("{value} "); // Prints "0 1 2 3 4"
}

