Both .NET and Rust support asynchronous programming models, which look similar to each other with respect to their usage. The following example shows, on a very high level, how async code looks like in C#: async Task<string> PrintDelayed(string message, CancellationToken cancellationToken)
{ await Task.Delay(TimeSpan.FromSeconds(1), cancellationToken); return $"Message: {message}";
} Rust code is structured similarly. The following sample relies on async-std for the implementation of sleep: use std::time::Duration;
use async_std::task::sleep; async fn format_delayed(message: &str) -> String { sleep(Duration::from_secs(1)).await; format!("Message: {}", message)
} The Rust async keyword transforms a block of code into a state machine that implements a trait called Future , similarly to how the C# compiler transforms async code into a state machine. In both languages, this allows for writing asynchronous code sequentially. Note that for both Rust and C#, asynchronous methods/functions are prefixed with the async keyword, but the return types are different. Asynchronous methods in C# indicate the full and actual return type because it can vary. For example, it is common to see some methods return a Task<T> while others return a ValueTask<T>. In Rust, it is enough to specify the inner type String because it's always some future ; that is, a type that implements the Future trait. The await keywords are in different positions in C# and Rust. In C#, a Task is awaited by prefixing the expression with await. In Rust, suffixing the expression with the .await keyword allows for method chaining , even though await is not a method. See also: Asynchronous programming in Rust

