From the following example the PrintDelayed method executes, even though it is not awaited: var cancellationToken = CancellationToken.None;
PrintDelayed("message", cancellationToken); // Prints "message" after a second.
await Task.Delay(TimeSpan.FromSeconds(2), cancellationToken); async Task PrintDelayed(string message, CancellationToken cancellationToken)
{ await Task.Delay(TimeSpan.FromSeconds(1), cancellationToken); Console.WriteLine(message);
} In Rust, the same function invocation does not print anything. use async_std::task::sleep;
use std::time::Duration; #[tokio::main] // used to support an asynchronous main method
async fn main() { print_delayed("message"); // Prints nothing. sleep(Duration::from_secs(2)).await;
} async fn print_delayed(message: &str) { sleep(Duration::from_secs(1)).await; println!("{}", message);
} This is because futures are lazy: they do nothing until they are run. The most common way to run a Future is to .await it. When .await is called on a Future, it will attempt to run it to completion. If the Future is blocked, it will yield control of the current thread. When more progress can be made, the Future will be picked up by the executor and will resume running, allowing the .await to resolve (see async/.await ). While awaiting a function works from within other async functions, main is not allowed to be async . This is a consequence of the fact that Rust itself does not provide a runtime for executing asynchronous code. Hence, there are libraries for executing asynchronous code, called async runtimes . Tokio is such an async runtime, and it is frequently used. tokio::main from the above example marks the async main function as entry point to be executed by a runtime, which is set up automatically when using the macro.

