In .NET, Task.WhenAny and Task.WhenAll are frequently used to handle the execution of multiple tasks. Task.WhenAny completes as soon as any task completes. Tokio, for example, provides the tokio::select! macro as an alternative for Task.WhenAny, which means to wait on multiple concurrent branches. var cancellationToken = CancellationToken.None; var result = await Task.WhenAny(Delay(TimeSpan.FromSeconds(2), cancellationToken), Delay(TimeSpan.FromSeconds(1), cancellationToken)); Console.WriteLine(result.Result); // Waited 1 second(s). async Task<string> Delay(TimeSpan delay, CancellationToken cancellationToken)
{ await Task.Delay(delay, cancellationToken); return $"Waited {delay.TotalSeconds} second(s).";
} The same example for Rust: use std::time::Duration;
use tokio::{select, time::sleep}; #[tokio::main]
async fn main() { let result = select! { result = delay(Duration::from_secs(2)) => result, result = delay(Duration::from_secs(1)) => result, }; println!("{}", result); // Waited 1 second(s).
} async fn delay(delay: Duration) -> String { sleep(delay).await; format!("Waited {} second(s).", delay.as_secs())
} Again, there are crucial differences in semantics between the two examples. Most importantly, tokio::select! will cancel all remaining branches, while Task.WhenAny leaves it up to the user to cancel any in-flight tasks. Similarly, Task.WhenAll can be replaced with tokio::join! .

